import React, { useState, useEffect } from 'react';

function App() {
  const [participantes, setParticipantes] = useState([]);

  useEffect(() => {
    // Realiza una solicitud GET a la ruta /json/participantes de tu backend Flask
    fetch('http://localhost:5000/json/participantes')
      .then((response) => response.json())
      .then((data) => setParticipantes(data));
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Mi Aplicaci√≥n React</h1>
        <h2>Participantes:</h2>
        <ul>
          {participantes.map((participante) => (
            <li key={participante.correo}>{participante.nombre}</li>
          ))}
        </ul>
      </header>
    </div>
  );
}

export default App;
